import { Grid } from "@material-ui/core";
function Footer(){
    return(
        <>
            <Grid container spacing={1}>
                <Grid item xs={12}>
                    <span>Desenvolvido por Pedro Trudes</span>
                </Grid>
            </Grid>
        </>
    );
}

export default Footer
